(3, 3, 'Description: Wave around this cat toy and entice your cat to jump into play!', 'Price: $2.98\r\n------> Click Link Below to Purchase', 'https://www.chewy.com/frisco-bird-teaser-feathers-cat-toy/dp/187920?utm_source=google-product&utm_medium=cpc&utm_campaign=hg&utm_content=Frisco&utm_term=&gclid=Cj0KCQjwsLWDBhCmARIsAPSL3_3h7Lugp2cSgu5LN1USu8rpLvhzFmXerpPZC4jseG3jLEfh5n-K1pIaAnOSEALw_wcB', '2021-04-07'),
(4, 4, 'Description: The You & Me Wood Bird Swing provides a comfortable place to rest and exercise. It also helps relieve boredom by keeping your bird stimulated inside of their habitat.', 'Price: $3.79\r\n------> Click Link Below to Purchase', 'https://www.petco.com/shop/en/petcostore/product/you-and-me-wood-bird-swing-medium-2504587?cm_mmc=PSH-_-GGL-_-SPP-_-PME-_-PET-_-AQU-_-0-_-PM_GGL_FY20_SBU04_PrivateLabel-You%26Me_NewCust_PLA-SMRT-_-0-_-0&gclid=Cj0KCQjwsLWDBhCmARIsAPSL3_29yBYyNtaCdOqgD9V9qI73HozJvx_uBkenw3vAtctJaMoRzSU-gAAaAqc4EALw_wcB&gclsrc=aw.ds', '2021-04-07'),
(5, 5, 'Description: The squeaky hot dog separates from the bun to provide hours of fun for any dachshund with a particularly high prey drive — it’s a great choice for hunting down in a game of fetch.', 'Price: $7.90\r\n------> Click Link Below to Purchase', 'https://witzig.com/collections/all/products/hot-dog-squeaky-toy?gclid=CjwKCAjw07qDBhBxEiwA6pPbHtUbb0wqHrK8aPk67Rd_1hytwzFRpMTdODJoi4ZmEC89RhD9sSe6xxoCRu4QAvD_BwE', '2021-04-08'),
