(8, 8, 'Description: Peek-a-Boo Pipe is the perfect place for terrific tunneling fun solo-style or with favorite pals. Crinkle sound will make your cat go wild!', 'Price: $14.99\r\n------> Click Link Below to Purchase', 'https://www.petco.com/shop/en/petcostore/product/leaps-and-bounds-peek-a-boo-pipe-cat-tunnel-51-l-x-95-w-2304446?cm_mmc=PSH-_-GGL-_-SPP-_-PME-_-PET-_-AQU-_-0-_-PM_GGL_FY21_SBU04_PrivateLabel-Leaps%26Bounds_LIA-SMRT-_-0-_-0&gclid=CjwKCAjw07qDBhBxEiwA6pPbHiN4QSvnvZ7PRSShffv9z4SCTjoh-Cqb9QHlVWKkx3RXA6ydsRw8yBoCKPoQAvD_BwE&gclsrc=aw.ds', '2021-04-08'),
(9, 9, 'Description: The Extrovert Water-Resistant Colorblocked Dog/Pig Harness features: a Webbed nylon with a water-resistant rubber coating, Easy for your pet parent to clean, and Mesh along chest and belly for comfort', 'Price: $24.99\r\n------> Click Link Below to Purchase', 'https://www.petco.com/shop/en/petcostore/product/youly-the-extrovert-water-resistant-colorblocked-dog-harness-medium-3243112?cm_mmc=PSH-_-GGL-_-SPP-_-PME-_-PET-_-AQU-_-0-_-PM_GGL_FY21_SBU04_PrivateLabel-Youly_LIA-SMRT-_-0-_-0&gclid=CjwKCAjw07qDBhBxEiwA6pPbHqQodegH7gxqxD9faiH8qXpgNUkFT1zFsfDRtD3XBXvTEMvGuqdP4xoC8MsQAvD_BwE&gclsrc=aw.ds', '2021-04-08'),
